/// Given a string s, find the length of the **longest substring**
/// without repeating characters.
///
/// Example 1:
/// ```
/// Input: s = "abcabcbb"
/// Output: 3
/// Explanation: The answer is "abc", with the length of 3.
/// ```
///
/// Example 2:
/// ```
/// Input: s = "bbbbb"
/// Output: 1
/// Explanation: The answer is "b", with the length of 1.
/// ```
/// Example 3:
///
/// ```
/// Input: s = "pwwkew"
/// Output: 3
/// Explanation: The answer is "wke", with the length of 3.
/// Notice that the answer must be a substring, "pwke" is a subsequence and not a substring.
/// ```
///  
///
/// Constraints:
/// - 0 <= s.length <= 5 * 104
/// - s consists of English letters, digits, symbols and spaces.
/// ```
fn main() {
    let s = "aabcdeefgh";
    length_of_longest_substring_without_repeats_combinators(s);
}

fn no_repeated_chars(s: &str) -> bool {
    use std::collections::HashSet;

    if s.is_empty() {
        return false;
    }

    let mut characters_seen = HashSet::<char>::new();

    for character in s.chars() {
        if !characters_seen.insert(character) {
            return false;
        }
    }

    true
}

fn all_sub_sequences(s: &str) -> impl Iterator<Item = &str> {
    s.char_indices()
        .map(move |(end, _)| {
            s.char_indices()
                .filter_map(move |(start, _)| s.get(start..=end))
        })
        .flatten()
}

fn length_of_longest_substring_without_repeats_combinators(s: &str) -> usize {
    return all_sub_sequences(s)
        .filter(|sub_str| !sub_str.is_empty() && no_repeated_chars(sub_str))
        .max_by_key(|sub_str| sub_str.len())
        .unwrap_or_default()
        .len();
}

fn length_of_longest_substring_without_repeats_loops(s: &str) -> usize {
    use std::collections::HashMap;
    let mut longest = "";

    let mut length = 0;
    let mut character_index_map = HashMap::<char, usize>::new();

    let mut chars = s.chars().enumerate();
    while let Some((index, character)) = chars.next() {
        let (index, character) = if character_index_map.contains_key(&character) {
            length = length.max(character_index_map.len());
            character_index_map.clear();
            chars.next().unwrap_or((index, character))
        } else {
            (index, character)
        };

        character_index_map.insert(character, index);
    }

    return length;
}

fn length_of_longest_substring_without_repeats(s: &str) -> usize {
    let mut length = 0;
    let mut start_index = 0;

    let mut seen_characters = std::collections::HashMap::<char, usize>::new();

    for (character_index, character) in s.chars().enumerate() {
        if let Some(seen_character_index) = seen_characters.get(&character) {
            start_index = start_index.max(seen_character_index + 1);
        }

        length = length.max(character_index - start_index + 1);

        seen_characters.insert(character, character_index);
    }

    return length;
}

